description:
Put It In Your Mouth - Japan!

1st and (technically) 2nd seasons of the youtube series Put It In Your Mouth.

A comedic cooking show between a bunch of buddies hanging out in a Japanese apartments. Has long since been removed from youtube following some sort of drama between the creators.

